function newClassNode(c, parentNode) {
    if (!c) return;
    var node = {name: (c.displayName || c.name), 
        children: [], value: 10};
    parentNode.children.push(node)

    Properties.own(c.categories).sort().each(function(name) {
            var categoryNode = {name: name, 
                children: [], value: 10};
            c.categories[name].each(function(methodName) {
                var method =  c.prototype[methodName];

                var methodNode = {name: methodName, 
                    value: method ? method.length : 1};
                categoryNode.children.push(methodNode)
            })
            node.children.push(categoryNode)
    })

}

