function newModuleNode(moduleObject, parentNode) {
    var node = {children: [], name: moduleObject.name(), value: 10};
    if (parentNode) {
        if (!parentNode.children) {parentNode.children = []};
        parentNode.children.push(node)
    }

    moduleObject.classes().forEach(function(ea) {
        this.newClassNode(ea, node)
    }, this)

    moduleObject.subNamespaces().forEach(function(ea) {
        this.newModuleNode(ea, node)
    }, this)

    return node
}

